// App.js
import React from 'react';
import { BrowserRouter as Router, Link } from 'react-router-dom';
import AppRoutes from './router/routes'; // Uvezite AppRoutes iz routes.js

function App() {
  return (
    <Router>
      <div>
        <h1>Aplikacija za Lov</h1>
        <Link to="/popis-bodova"><button>Bodovi</button> </Link>
        <Link to="/popis-bodova"><button>Bodovi</button> </Link>
        <AppRoutes /> {/* Koristite AppRoutes komponentu za prikaz rute */}
      </div>
    </Router>
  );
}

export default App;
